import React from "react";

const firstName = "Jorge";
const secondName = "arias";

class Develop extends React.Component {
	render() {
		return (
			<div>
				<h1>
					Your Strategy is onlu as good <br /> as your ability to execute it.
					{firstName}
				</h1>
				<p>
					Perdoo is a simple but powerful toolkit for turning great <br />
					strategies into amaizing results. And it`s free.
					{secondName}
				</p>
			</div>
		);
	}
}

export default Develop;
